import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <div className="logoMenu"><h1>TEMBO GROUP</h1></div>
      <div className="headerMenu">HOME</div>
      <div className="headerMenu">BRAIN TRUST</div>
      <div className="headerMenu">CAREERS</div>
      <div className="headerMenu">ABOUT</div>
      <div className="headerMenu">CONTACT</div>
    </div>
  );
}

export default App;
